if (propertyListing) {
  const propListing = Array.prototype.slice.call(propertyListing);
  propListing.forEach((listing) => {
    listing.childNodes[0].childNodes[3].childNodes[0].childNodes[0].addEventListener(
      "click",
      function () {
        listing.style.display = "none";
      }
    );
