if (blogListing) {
  const bloListing = Array.prototype.slice.call(blogListing);
  bloListing.forEach((listing) => {
    listing.childNodes[0].childNodes[3].childNodes[0].childNodes[0].addEventListener(
      "click",
      function () {
        listing.style.display = "none";
      }
    );
